<body>
<div class="row">
  <div class="columns small-12">
    <h3>How would elections change with demographic preferences?</h3>
    <h5>Add voting modifiers below to see how the election would have played out if some groups had voted differently</h5>
  </div>
</div>

<div class="row">
  <div class="columns medium-4">

    <label>Demographic Category</label>
    <select class="ms-input ms-input-category" name="CATEGORY">
      <option value="gender">Gender</option>
      <option value="race">Race</option>
      <option value="age">Age</option>
      </select>
  </div>
  <div class="columns medium-4">
    <label>Group</label>
    <select class="ms-input" name="DEMOGRAPHIC" id="DEMOGRAPHIC">
      <option value="Male">Male</option>
      <option value="Female">Female</option>
    </select>
  </div>
  <div class="columns medium-4">
    <label>Change in Behavior</label>
    <select class="ms-input ms-input-type" name="TYPE">
      <option value="margin">Margin</option>
      <option value="turnout">Turnout</option>
    </select>
  </div>
  <div class="row">
    <div class="columns medium-2"><label id="shift_label_prefix">Lower Turnout</label></div>
    <div class="columns medium-8">
          <input type="range" name="SHIFT" class="ms-input ion" data-min="-50" min="-50" data-max="50" max="50" value="0" data-step="1" data-grid="true" data-grid-num="1" data-postfix="%" >
    </div>
    <div class="columns medium-2"> <label id="shift_label_postfix">Higher Turnout</label></div>
    
  </div>
  <div class="row"></div>
    <div class="columns medium-5">
      <button class="ms-input-submit" type="button" name="SUBMIT"">Add Modifier</button>
      <br>
      <div class="columns medium-12">
        <label>Map View</label>
        <select id="mapview">
          <option value="electoral">Electoral College</option>
          <option value="popular">Popular Vote</option>
          <option value="demographic">Demographic</option>
          <option value="differential">Popular vote differential from 2016 map</option>
          <option value="electoral-differential">Electoral differential from 2016 map</option>
        </select>
      </div>
      <div class="columns medium-6" id="demographicviewtypediv" hidden>
        <label>Demographic View Type</label>
        <select id="demographicviewtype">
          <option value="gender">Gender</option>
          <option value="race">Race</option>
          <option value="age">Age</option>
        </select>
      </div>
      <div class="columns medium-6" id="demographicviewvaluediv" hidden>
        <label>Demographic View Value</label>
        <select id="demographicviewvalue">
          <option value="Male">Male</option>
          <option value="Female">Female</option>
        </select>
      </div>
    </div>
    <div class="columns medium-7" id="current_modifiers_row" style="max-height: 145px; overflow: scroll">
      <span id="result"></span>
    </div>
  </div>
</div>
  
 
</div>

</div>
